import React, { Component } from 'react';
import './App.css'; //compiled with scss

import Header from "./Header/Header.js";
import Footer from "./Footer/Footer.js";
import Axios from 'axios';

class App extends Component {
  constructor(){
    super();
    this.state = {
      queens: []
    }
  }

  componentDidMount() {
    this.getQueens();
  }

  getQueens = () => {
    Axios({
      method: "GET",
      url: "http://www.nokeynoshade.party/api/queens/all",
      dataResponse: "json"
    }).then(response => {
      response = response.data;
      console.log(response);
      this.setState({
        queens: response
      })
    })
  }








  render() {
    return (
      <div className="App">
        <Header />
        { this.state.queens.map(queen => {
          return (
            <div key={queen.id}>
              <img src={queen.image_url} alt=""/>
              <p>{queen.name}</p>
              <p>{queen.quote}</p>
            </div>
          )
        })}
        <Footer />
      </div>
    );
  }
}

export default App;
